/* eslint-disable */
import { useEffect, useState } from 'react';
import { Icon } from '@iconify/react';
import plusFill from '@iconify/icons-eva/plus-fill';
import { Link as RouterLink } from 'react-router-dom';
// material
import { Grid, Button, Container, Stack, Typography } from '@mui/material';
// components
import Page from '../components/Page';
import { BlogPostCard, BlogPostsSort, BlogPostsSearch } from '../components/_dashboard/blog';
//
import POSTS from '../_mocks_/blog';
import faker from 'faker';
// utils
import { mockImgCover } from '../utils/mockImages';
//import posts from '../_mocks_/blog';

// ----------------------------------------------------------------------

const SORT_OPTIONS = [
  { value: 'latest', label: 'Latest' },
  { value: 'popular', label: 'Popular' },
  { value: 'oldest', label: 'Oldest' }
];

// ----------------------------------------------------------------------

export default function Blog() {
  console.log('Umfragen');
  const [posts, setPosts] = useState([]);
  useEffect(() => {
    getAllVideos();
  }, []);


  function getAllVideos() {
    const myHeaders = new Headers();
    myHeaders.append("Authorization", "Bearer eyJhbGciOiJSUzI1NiIsInR5cCI6IkpXVCIsImtpZCI6Ik1UTkJRamhFUmpZd05VRXlRakpFUkRGRk5rSXpPRGc0T0RZMlFqWTNSamd3TURoRVFUVTROZyJ9..PZUZGAP77go9lGpE3orxQyJVprOOdxrPZ6lAgsr9Wj5PFD3uqeb2wMwfUhS5LvOQLf3vLQhV0EMfF9j0q38wtWB5_Eq8Om-D4PgVayhoblC5A8W9mIMBghO1eAKqUS5PZmtLQ2f_l-zik3b2m3NYG6ireGVP7Rty_LgZVh_2jkUwVa5yuNzRKiazyqOg5Gc99C5sGsAHES1jgWXL5azaTP3cXp_BJ79zX2nZkRlBtQT9BTTnsnQkBiaQ-xmEM1GKJyDOHmVDD0coQq34XDRQIpyMZXZxTFmuj_BnjFcXJFgWnEM5_Q5C_QUszz8vAufPFiZ6nWKHHyzsOa6wtXgQxw");

    let requestOptions = {
      method: 'GET',
      headers: myHeaders,
      redirect: 'follow'
    };

    fetch("https://api.videoask.com/forms?limit=0&offset=0&title=", requestOptions)
      .then((response) => {
        // if(response.status!==200)
        // {
        //   throw new Error(response.status)
        // }
        response.text();
      })
      .then((result) => {
        console.log(result);
        // extractVideoId(JSON.stringify(result));
      })
      .catch((error) => console.log('error', error));
  }

  function extractVideoId(apiResult) {
    console.log(apiResult);
    // var jsonApi = JSON.parse('{"next":null,"previous":null,"results":[{"are_answers_public":false,"are_messages_public":false,"author_id":"13282091-c437-4b79-a419-91b963e9eaa5","created_at":"2021-09-27T08:38:22.318808Z","first_question":{"allow_multiple_selection":false,"answers_count":0,"collect_contact_information":true,"created_at":"2021-09-27T08:39:40.915862Z","form_id":"f7d917e6-039a-4a44-b5aa-324f9e7cabf4","label":"1 Test","logic_actions":[{"action":"jump","details":{"to":{"type":"goodbye","value":"default"}},"condition":{"op":"always","vars":[]}}],"media_id":"38fa68b5-e99a-4953-9361-63f11ffe1e68","media_type":"video","media_url":"https://media2.giphy.com/media/xT0GqHQxfxp6GcwKbu/giphy.mp4?…2jbe3wydj8qh560mdsb8rp4ky61yjpvcw85ig1zpg&rid=giphy.mp4&ct=g","metadata":{"text":"Test","darken_text_background":false,"fit_video":true,"overlay_text_size":7},"poll_options":[{"id":"1a438cce-b56c-4b00-97d0-f7bc6533ec77","option_id":"1a438cce-b56c-4b00-97d0-f7bc6533ec77","content":"0-20","total_count":0,"ref":"7e3f5fb5-3402-4d33-83c5-629828daf12c"},{"id":"69d9597d-6d35-4351-be13-a3ce71716bb7","option_id":"69d9597d-6d35-4351-be13-a3ce71716bb7","content":"20-40","total_count":0,"ref":"e8f43b8f-f800-4bd3-bdb6-6db273c4ac25"}],"count":1}');
    var jsonAPI = JSON.parse(apiResult);
    var videoArray = jsonApi.results;
    const posts = [videoArray.length];
    // console.log(POSTS);
    videoArray.forEach(function (value, i) {
      posts[i] = {
        id: value.form_id,
        cover: value.first_question.thumbnail,
        title: value.title,
        createdAt: value.created_at,
        view: faker.datatype.number(),
        comment: faker.datatype.number(),
        share: faker.datatype.number(),
        favorite: faker.datatype.number(),
        url: value.share_url,

        author: {
          name: value.author_id,
          avatarUrl: `/static/mock-images/avatars/avatar_${i + 1}.jpg`
        }
      }
    });
    setPosts(posts)
    console.log(posts);
  }

  return (
    <Page title="Dashboard: Blog | Minimal-UI">
      <Container>
        <Stack direction="row" alignItems="center" justifyContent="space-between" mb={5}>
          <Typography variant="h4" gutterBottom>
            Umfragen
          </Typography>
          {/* <Button
            variant="contained"
            component={RouterLink}
            to="#"
            startIcon={<Icon icon={plusFill} />}
          >
            New Post
          </Button> */}
        </Stack>

        {/* <Stack mb={5} direction="row" alignItems="center" justifyContent="space-between">
          <BlogPostsSearch posts={POSTS} />
          <BlogPostsSort options={SORT_OPTIONS} />
        </Stack> */}

        <Grid container spacing={3}>
          {posts.map((post, index) => (
            <BlogPostCard key={post.id} post={post} index={index} />
          ))}
        </Grid>
      </Container>
    </Page>
  );
}
